import React, { Component } from 'react'

class Login extends Component {

    constructor() {
        super();
        this.state = {
            items: ['ajay', 'ak', 'ak10']
        }
    }
    render() {
        var list = this.state.items.map((itm, k) => {
            return <li>{itm}</li>
        })
        return (
            <div>
                <h1>Welcome to login Form</h1>
                {list}
            </div>
        )
    }


}

export default Login;
